import React, {useState, useEffect} from 'react';

export default function Student() {
  const [state, setState] = useState(null);
  useEffect(() => {
    fetch('/api/test')
      .then((res) => res.json())
      .then((data) => setState(data))
      .catch((err) => console.log(err));
  })

  return <div>{state}</div>;
}
